function pixilated(el)
{
	let ctx = el.getContext('2d');
	const pixel = 100;


	let isMouseDown = false;

	const canvSize = canv.width;
	
	const cellSize = canvSize / pixel;
	this.drawCell = function(x, y, w, h)
	{
		ctx.fillStyle = computedStyle.getPropertyValue("--error");
		ctx.strokeStyle = computedStyle.getPropertyValue("--error");
		ctx.lineJoin = 'miter';
		ctx.lineWidth = 1;
		ctx.rect(x, y, w, h);
		ctx.fill();
	}

	this.clear = function() 
	{
		ctx.clearRect(0, 0, canvSize, canvSize);
	}
	this.calculate = function(draw = false) 
	{										
		const cellOffset = canvSize / cellSize;
		
		const vector = [];
		let cellsArray = [];

		for (let x = 0; x < canvSize; x += cellOffset)
		{
			for (let y = 0; y < canvSize; y += cellOffset)
			{
				const data = ctx.getImageData(x, y, cellOffset, cellOffset);

				let nonEmptyPixelsCount = 0;
				for (i = 0; i < data.data.length; i += 10)
				{
					const isEmpty = data.data[i] === 0;

					if (!isEmpty)
					{
						nonEmptyPixelsCount += 1;
					}
				}

				if (nonEmptyPixelsCount > 1 && draw)
				{
					cellsArray.push([x, y, cellOffset, cellOffset]);
				}

				vector.push(nonEmptyPixelsCount > 1 ? 1 : 0);
			}
		}

		if (draw)
		{
			this.clear();
			

			for (cell in cellsArray)
			{
				this.drawCell(cellsArray[cell][0], cellsArray[cell][1], cellsArray[cell][2], cellsArray[cell][3]);
			}
		}

		return vector;
	}

	 

	el.addEventListener('mousedown', function(e) {
		isMouseDown = true;
		ctx.beginPath();
		if (e.button == 0)
		{
			ctx.fillStyle = computedStyle.getPropertyValue("--primary");
			ctx.strokeStyle = computedStyle.getPropertyValue("--primary");
			ctx.lineWidth = pixel;

			ctx.beginPath();
			ctx.fillRect(parseInt(e.offsetX/pixel)*pixel, parseInt(e.offsetY/pixel)*pixel, pixel, pixel);
			ctx.fill();

			ctx.beginPath();
			ctx.moveTo(e.offsetX, e.offsetY);		
		}

		else if (e.button == 2)
		{		
			window.oncontextmenu = function()
			{
				return false;
			}

			ctx.beginPath();
			ctx.clearRect(parseInt(e.offsetX/pixel)*pixel, parseInt(e.offsetY/pixel)*pixel, pixel, pixel);
			ctx.fill();

			ctx.beginPath();
			ctx.moveTo(e.offsetX, e.offsetY);	
		}
	})

	el.addEventListener('mouseup', function(e) {
		isMouseDown = false;
	})
		
}
