function mostLikely(input, net) {
  let notEmptyCheck = false
  for (let i = 0; i < 25; i++)
    if (input[i] == 1)
    {
      notEmptyCheck = true;
      break;
    }
  
  if (notEmptyCheck)
  {
    const output = net.run(input);
    let maxProp = null;
    let maxValue = -1;
    Object.entries(output).forEach(([key, value]) => {
        if (typeof value !== 'undefined' &&
            typeof value === 'number' &&
            value > maxValue) {
            maxProp = key;
            maxValue = value;
        }
    });
    return maxProp;
  }
  else
    return "NaN";
}

